import './navbar.css'
// import React from 'react';
import {Nav, Navbar, Container} from 'react-bootstrap';
import logo from './planet-earth.svg'
import icon1 from './harvest.svg'
import icon2 from './spinach.svg'
import icon3 from './earthworm.svg'

import {React, useState} from 'react';
import {Modal} from 'react-bootstrap'
import SlidingPanel from 'react-sliding-side-panel';

const Menu = () => {

    const [lgShow, setLgShow] = useState(false);
    const [openPanel, setOpenPanel] = useState(false);

    return(
        <Navbar expand="lg" bg="dark" variant="dark">
            <Container>
            <Navbar.Brand><img className="logo" alt="mapeo-huertos" src={logo} width="40px" height="40px" /> Mapeo de Huertos</Navbar.Brand>
            <Nav className="menu-items">
            <Nav.Link href="/">Home<img className="logo" alt="mapeo-huertos" src={icon1} width="30px" height="30px" /></Nav.Link>
            <Nav.Link href="/">Formulario<img className="logo" alt="mapeo-huertos" src={icon2} width="27px" height="30px" /></Nav.Link>
            <Nav.Link href="#contacto">Contacto <img className="logo" alt="mapeo-huertos" src={icon3} width="27px" height="30px" /></Nav.Link>

            <Nav.Link onClick={() => setLgShow(true)}>Formulario<img className="logo" alt="mapeo-huertos" src={icon2} width="27px" height="30px" /></Nav.Link>
            <Modal
            size="lg"
            show={lgShow}
            onHide={() => setLgShow(false)}
            aria-labelledby="example-modal-sizes-title-lg"
            >
            <Modal.Header closeButton>
                <Modal.Title id="example-modal-sizes-title-lg">
                ¿Cómo agregar un huerto?
                </Modal.Title>
            </Modal.Header>
            <Modal.Body>
                El propósito de este mapeo es identificar huertos para crear una red atónoma 
                de la que surjan colaboraciones en torno a la agricultura urbana y la soberanía 
                alimentaria. Ingresa al formulario y registra tu huerto.
            </Modal.Body>
            </Modal>




            <button onClick={() => setOpenPanel(true)}>Open</button>

            <SlidingPanel
                type={'left'}
                isOpen={openPanel}
                size={30}
            >
            <div>
                <div>My Panel Content</div>
                <button onClick={() => setOpenPanel(false)}>close</button>
            </div>
            </SlidingPanel>


            </Nav>
            </Container>
        </Navbar>
    );
}

export default Menu;
